products.description:
Durably made with safety, comfort, and functionality, our long-lasting dog ID collar is highly reflective;
strong, non-corrosive stainless steel D-ring for leash;
high-quality and secure lock buckle;
7 collar colors to choose from: Blue, Black, Purple, Hot Pink, Orange, Light Pink, and Green.
Personalized Embroidery: embroidery is permanently stitched through the collar for strength and long-lasting identification.
To determine the correct collar size for your dog, please use a soft tape measure or piece of string and wrap it snugly around the base of your dog’s neck – snug enough so that you cannot fit any fingers under the measuring tape. Your pet’s measured neck size must fit within the collar’s adjustable length range. For instance, if your dog’s neck measures 13” inches order an 11”-16” inch adjustable collar.
4 adjustable collar sizes:
Extra-Small(5/8inch wide by 9-12 inches);
Small (5/8 inch wide by 12-16 inches);
Medium (3/4 inch wide by 15 -18.5 inches);
Large (1 inch wide by 18-26 inches).
please note: In some cases, when sizing the collar down, the adjustable slider might cover some of the custom embroideries.
Customer satisfaction is our ultimate pursuit. If you have any problem, please get in touch with us and we will offer you a satisfactory solution immediately.
